create table Clients (
	ID INT,
	Login VARCHAR(50),
	Firstname VARCHAR(50),
	Surname VARCHAR(50),
	Is_company VARCHAR(50),
	Name DECIMAL(10,2),
	NIP DECIMAL(10,2),
	City VARCHAR(50),
	Address DECIMAL(10,2),
	Phone VARCHAR(50),
	Email VARCHAR(50),
	Password VARCHAR(50),
	Password_last_change DATE
);
